      private object ParseSoapResponse(string sSoapXml, Type type)
        {
            Response response = null;
            if (sSoapXml != null && sSoapXml.Length > 0)
            {
                String str = sSoapXml.Substring(sSoapXml.IndexOf("<Response"));
                str = str.Substring(0, str.IndexOf("</SOAP-ENV:Body>"));
                str = str.Replace("<Response xmlns=\"http://cisco.com/mse/location\">", "<Response>");
                System.Xml.XmlDocument doc = new System.Xml.XmlDocument();
                doc.LoadXml(str);
                doc.DocumentElement.SetAttribute("xmlns", "http://cisco.com/mse/location");
                System.Xml.XmlNamespaceManager xmlnsManager = new System.Xml.XmlNamespaceManager(doc.NameTable);

                //Add the namespaces used in books.xml to the XmlNamespaceManager.
                xmlnsManager.AddNamespace(String.Empty, "http://cisco.com/mse/location");


                MemoryStream memStream = new MemoryStream(UTF8Encoding.UTF8.GetBytes(sSoapXml));
                TextWriter twOut = new StringWriter();
                XmlTextReader reader = new XmlTextReader(memStream);

                XmlNoNamespaceWriter writer = new XmlNoNamespaceWriter(twOut);
                writer.WriteNode(reader, true);
                sSoapXml = twOut.ToString();

                XmlDocument soapXml = new XmlDocument();
                soapXml.LoadXml(sSoapXml);
                XmlNode Node = soapXml.ChildNodes.Item(0);
                string sResp = doc.FirstChild.OuterXml;
				UTF8Encoding encoding = new UTF8Encoding();
                Byte[] byteArray = encoding.GetBytes(sResp);
             
                try
                {
                    XmlSerializer xs = new XmlSerializer(type);
                    using (MemoryStream memoryStream = new MemoryStream(byteArray))
                    {
                        response = (Response)xs.Deserialize(memoryStream);
                        
                    }
                }
                catch (Exception ex)
                {
                    Trace.WriteLine("Inside catch");
                    Trace.WriteLine(ex.Message);
                    return response;
                }
            }
            return response;
        }




